-- ----------------------------
-- Table structure for personnel_archives
-- ----------------------------
DROP TABLE IF EXISTS `personnel_archives`;
CREATE TABLE `personnel_archives` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `work_number` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '工号',
  `name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '姓名',
  `id_card` varchar(18) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '身份证号',
  `contact_number` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '联系方式',
  `gender` enum('男','女') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '性别',
  `nationality` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '民族',
  `political_status` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '政治面貌',
  `center` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '中心',
  `position` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '岗位',
  `job_level` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '职级',
  `team` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '班组',
  `employment_type` enum('合同制','劳务用工','实习') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用工性质',
  `hire_date` date DEFAULT NULL COMMENT '入职时间',
  `confirm_date` date DEFAULT NULL COMMENT '转正时间',
  `origin_place` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '籍贯',
  `hukou_type` enum('省内城镇','省外城镇','省内农村','','省外农村') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '户籍性质',
  `home_address` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '家庭住址',
  `marital_status` enum('未婚','已婚','离异','丧偶') COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '婚姻状况',
  `emergency_contact` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '紧急联系人',
  `work_years` int(11) DEFAULT NULL COMMENT '工龄',
  `education` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '学历',
  `certification` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '证书',
  `recruitment_channel` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '招聘渠道',
  `vehicle_info` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '车辆信息',
  `previous_employer` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '上家单位信息',
  `accommodation` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '住宿',
  `alma_mater` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '毕业院校',
  `major` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '所学专业',
  `promotion_info` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '晋升/调动信息',
  `contract_number` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '合同编号',
  `contract_type` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '合同类型',
  `contract_start` date DEFAULT NULL COMMENT '合同开始时间',
  `contract_end` date DEFAULT NULL COMMENT '合同结束时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `work_number` (`work_number`),
  KEY `idx_name` (`name`),
  KEY `idx_center` (`center`),
  KEY `idx_position` (`position`),
  KEY `idx_job_level` (`job_level`)
) ENGINE=InnoDB AUTO_INCREMENT=7829 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='人事档案花名册';

